module.exports = "<p>\r\n  This was Team Data Dino Nuggets' submission for UCLA's 2021 DataFest, exactly as we submitted it.\r\n</p>\r\n\r\n<h1 class=\"page-title\">Substance Abuse and Mental Health</h1>\r\n<h2 class=\"page-title\">Is America's Opioid Crisis <br> the symptom of overarching mental health issues?</h2>\r\n\r\n<div class=\"top-summary\">\r\n  <p>As if the pandemic wasn't enough, it's no secret that America finds itself another epidemic: the opium epidemic. As of 2020, the US Department of Health and Human Services <a>reported over 70,000 dead by drug overdose</a> while the CDC declares an economic cost of <a href=\"https://www.drugabuse.gov/drug-topics/opioids/opioid-overdose-crisis\">$78.5 billion per year</a>.</p>\r\n\r\n  <p>In light of this, Rocky Mountain Poison and Drug Safety Center have been gathering hundreds of thousands of electronic survey responses \r\n    as part of an effort to gain a better understanding of who might be most vulnerable to, and if we're lucky, maybe even a little bit of insight into why.\r\n  </p>\r\n\r\n</div>\r\n\r\n<h2 class=\"section-title\">Exploring the relationship between mental health disorders and drug abuse</h2>\r\n\r\n  <!-- <img class=\"svg-tempscale\" src=\"../../../assets/img/Autism_and_NMU_Drug_Use.png\"> -->\r\n  <img class=\"svg-tempscale\" src=\"./assets/img/Autism_and_NMU_Drug_Use.png\">\r\n\r\n\r\n<br>\r\n<br>\r\n<br>\r\n\r\n<img class=\"svg-tempscale\" src=\"./assets/img/heatmap.png\">\r\n\r\n<br>\r\n<br>\r\n<br>\r\n\r\n<img class=\"svg-tempscale\" src=\"./assets/img/ment_adhd_nmu_ever.png\">\r\n\r\n<br>\r\n<br>\r\n<br>\r\n\r\n<img class=\"svg-tempscale\" src=\"./assets/img/ment_aut_nmu_ever.png\">\r\n\r\n<h2 class=\"section-title\">Comparing four mental health disorders across the states</h2>\r\n<p class=\"summary\">\r\n  After performing that exploratory analysis just to confirm that in general people diagnosed with mental health disorders were indeed disproportionately negatively affected, it was time to start creating some more sophisticated plots. Thanks to some guidance from the mentors, we realized it would be a very worthwhile pursuit to perform similar calculations and visualizations across all the different states. This would allows us to glean interesting information by comparing different <i>subsets</i> of the data - not only to see how people diagnosed living in different areas might be impacted by this substance abuse phenomenon differently, but also possibly even why. In particular, how might say the numbers may differ in rural states versus urban ones, or possibly if the fact many states were <a href=\"https://en.wikipedia.org/wiki/Timeline_of_cannabis_laws_in_the_United_States\">still in the process of legalization of recreational marijuana</a> at the time.\r\n</p>\r\n<div class=\"button-div\">\r\n  <button *ngIf=\"!scenarioAttention\" mat-stroked-button color=\"warn\" (click)=\"scenarioADHD()\">ADHD</button>\r\n  <button *ngIf=\"scenarioAttention\" mat-flat-button color=\"warn\">ADHD</button>\r\n  <button *ngIf=\"!scenarioAnx\" mat-stroked-button color=\"warn\" (click)=\"scenarioANX()\">Anxiety</button>\r\n  <button *ngIf=\"scenarioAnx\" mat-flat-button color=\"warn\">Anxiety</button>\r\n\r\n</div>\r\n<br>\r\n<div class=\"button-div\">\r\n  <button *ngIf=\"!scenarioAut\" mat-stroked-button color=\"warn\" (click)=\"scenarioAUTISM()\">Autism</button>\r\n  <button *ngIf=\"scenarioAut\" mat-flat-button color=\"warn\">Autism</button>\r\n  <button *ngIf=\"!scenarioDepre\" mat-stroked-button color=\"warn\" (click)=\"scenarioDEP()\">Depression</button>\r\n  <button *ngIf=\"scenarioDepre\" mat-flat-button color=\"warn\">    Depression    </button>\r\n</div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div id = 'title'>\r\n  <p class=\"summary\">Examine the difference between undiagnosed users who were perscribed drugs and then started using nonmedically, versus people diagnosed with <strong class=\"highlight\">{{this.scenario}}</strong> that were perscribed drugs then started using nonmedically:</p>\r\n  <!-- <button *ngIf=!play (click)=\"playButton()\" mat-mini-fab color=\"warn\" id=\"play\" aria-label=\"Example icon button with a menu icon\">\r\n    <mat-icon>play_arrow</mat-icon>\r\n  </button> -->\r\n  <button *ngIf=refresh (click)=\"refreshButton()\" mat-mini-fab color=\"warn\" id=\"refresh\" aria-label=\"Example icon button with a menu icon\">\r\n    <mat-icon>refresh</mat-icon>\r\n  </button>\r\n \r\n  \r\n</div>\r\n\r\n<h2 class=\"title-tag\">{{titleTag}}</h2>\r\n<mat-slider min={{min}} max={{max}} step={{step}} value={{value}} tickInterval={{tickInterval}} disabled=\"false\"  color=\"warn\" (input)=\"pitch($event)\"></mat-slider>\r\n<img class=\"svg-tempscale\" src='./assets/img/scale.png'>\r\n<div id=\"map\"></div>\r\n<div class = \"world-map\"></div>\r\n\r\n\r\n\r\n<div class = \"geopolitics-display\">\r\n  <div class=\"line-wrapper\">\r\n\r\n  </div>\r\n  <div class=\"country-content\">\r\n    <div *ngIf=\"scenarioADHD\" class = \"canada-div\">\r\n      <div class=\"line-wrapper\"></div>\r\n      <h2 class=\"projection-country\">ADHD</h2>\r\n      <p class=\"projection-title\">Distribution of DAST-10 Scores for Diagnosed vs. Undiagnosed Users</p>\r\n      <div class=\"projection-summary\">\r\n        <!-- <small class=\"projection-a2\"><strong>Scenario A2:</strong> 10.15 &#176;F</small> -->\r\n\r\n      </div>\r\n\r\n    </div>\r\n    <div *ngIf=\"scenarioAnx\" class = \"russia-div\">\r\n      <div class=\"line-wrapper\">\r\n\r\n      </div>\r\n      <h2 class=\"projection-country\">Anxiety</h2>\r\n      <p class=\"projection-title\">Distribution of DAST-10 Scores for Diagnosed vs. Undiagnosed Users</p>\r\n      <div class=\"projection-summary\">\r\n\r\n      </div>\r\n\r\n    </div>\r\n    <div *ngIf=\"scenarioAut\" class = \"afghanistan-div\">\r\n      <div class=\"line-wrapper\">\r\n\r\n      </div>\r\n      <h2 class=\"projection-country\">Autism</h2>\r\n      <p class=\"projection-title\">Distribution of DAST-10 Scores for Diagnosed vs. Undiagnosed Users</p>\r\n\r\n      </div>\r\n\r\n    </div>\r\n    <div *ngIf=\"scenarioDepre\" class = \"us-div\">\r\n      <div class=\"line-wrapper\">\r\n\r\n      </div>\r\n      <h2 class=\"projection-country\">Depression</h2>\r\n      <p class=\"projection-title\">Distribution of DAST-10 Scores for Diagnosed vs. Undiagnosed Users</p>\r\n      <div class=\"projection-summary\">\r\n      </div>\r\n\r\n    </div>\r\n  </div>\r\n\r\n\r\n\r\n"

